import React, { useState, useEffect, useRef } from "react";
import { useHistory } from "react-router-dom";

const EditDepartment = () => {
    const history = useHistory();
    const [showModal, setShowModal] = useState(false);
    const refcls = useRef(null);

    const updateData = () => {
        refcls.current.click();
        // Perform your update logic here
    }

    useEffect(() => {
        // When component mounts, show the modal
        setShowModal(true);
    }, []);

    const handleCloseModal = () => {
        setShowModal(false);
        // Redirect to another page after closing the modal
        history.push("/new-page");
    }

    return (
        <>
            {showModal && (
                <div className="modal fade show" id="exampleModal" tabIndex="-1" aria-labelledby="exampleModalLabel" aria-modal="true">
                    <div className="modal-dialog">
                        <div className="modal-content">
                            <div className="modal-header">
                                <h5 className="modal-title" id="exampleModalLabel">
                                    Edit Department
                                </h5>
                                <button type="button" className="btn-close" onClick={handleCloseModal}></button>
                            </div>
                            <div className="modal-body">
                                <div className="mb-3">
                                    <label htmlFor="departmentName" className="form-label" style={{ fontWeight: "500" }}>
                                        Department Name
                                    </label>
                                    <input
                                        type="text"
                                        className="form-control"
                                        id="departmentName"
                                        placeholder="Department Name"
                                    />
                                </div>
                                <div className="mb-3">
                                    <label htmlFor="departmentId" className="form-label" style={{ fontWeight: "500" }}>
                                        Department Id
                                    </label>
                                    <input
                                        type="text"
                                        className="form-control "
                                        id="departmentId"
                                        placeholder="Department Id"
                                    />
                                </div>
                            </div>
                            <div className="modal-footer">
                                <button type="button" className="btn btn-secondary" onClick={handleCloseModal} ref={refcls}>
                                    Close
                                </button>
                                <button type="button" className="btn btn-primary" onClick={updateData}>
                                    Update Department
                                </button>
                            </div>
                        </div>
                    </div>
                </div>
            )}
        </>
    );
};

export default EditDepartment;
